import React from 'react';
import xImg from '../../x.png'; 
import { Link } from 'react-router-dom';

function LoginPage() {
  return (
    <div className = 'container'>
            <div className = 'x-box'>
                <Link to='/'><img src = {xImg} className='x-img' /></Link>
            </div>
            <div className = 'login-box'>
                <h1 className='ft-big'>로그인</h1>
                <div className='id-box'>
                    <label className='ft-small' htmlFor="id-input">아이디</label>
                    <input className='text-box' type='text' />
                </div>  
                <div className='password-box'>
                    <label className='ft-small' htmlFor="id-input">비밀번호</label>
                    <input className='text-box' type='password' />
                </div>
                <button className = 'orange-btn'>로그인</button>
            </div>


    </div>
  );
}

export default LoginPage;
